import React, { Component } from "react";
import {
    Container, Row, Col, Table
} from 'react-bootstrap';
import logbook from "./images/Icons/Lobgook.png";

class Overview extends Component {
    render() {
        return (
            <div className="component_content overview">
                <Container>
                    <Row>
                        <Col xs={12} lg={6}>
                            <Table size="sm">
                                <tbody>
                                    <tr>
                                        <td>
                                        <p class="text-center icons">
                                            <span className="icons-image"><img src={logbook} alt="" width="58" class="mb-2 d-block mx-auto" /></span>
                                            LOGBOOK
                                        </p>
                                        </td>
                                        <td>Mark</td>
                                        <td>Otto</td>
                                        <td>@mdo</td>
                                    </tr>
                                    <tr>
                                        <td>2</td>
                                        <td>Jacob</td>
                                        <td>Thornton</td>
                                        <td>@fat</td>
                                    </tr>
                                </tbody>
                            </Table>
                        </Col>
                        <Col xs={12} lg={6}>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Overview;
